-- ----------------------------
-- Table structure for t_currency_records
-- ----------------------------
DROP TABLE IF EXISTS `t_currency_records`;
CREATE TABLE `t_currency_records`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '消费记录表',
  `user_id` int(11) NOT NULL COMMENT '用户表id',
  `amount` decimal(10, 2) NOT NULL COMMENT '充值或者消费金额',
  `type` tinyint(3) NOT NULL COMMENT '消费类型  1 充值 2 消费',
  `pay_status` tinyint(1) NOT NULL DEFAULT 0 COMMENT '状态 0 消费失败 1 消费成功',
  `pay_type` tinyint(3) NOT NULL COMMENT '支付类型 1 谷歌支付 2 苹果支付 3 点券支付',
  `content` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '消费记录说明',
  `add_time` datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `deleted` tinyint(1) NULL DEFAULT 0 COMMENT '是否软删除  1 删除',
  `c_order` int(11) NULL DEFAULT NULL COMMENT '如果是消费那么就是消费订单id， 如果是充值那就要根据充值类型判断 如果是充值点券那么就是 充值套餐id ，0 是其他套餐， 如果是开赏 那就 抽奖订单id',
  `order_type` tinyint(3) NULL DEFAULT NULL COMMENT '訂單類型 1：常規訂單 2. 抽獎訂單',
  `cz_type` tinyint(3) NULL DEFAULT NULL COMMENT '充值类型 1 点券充值 2 开赏赏品',
  `amount_type` tinyint(3) NULL DEFAULT NULL,
  `cz_time` datetime NULL DEFAULT NULL COMMENT '充值完成時間',
  `cz_order_no` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '充值訂單編號',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `user_id_index`(`user_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 335 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = COMPACT;

-- ----------------------------
-- Records of t_currency_records
-- ----------------------------

