-- ----------------------------
-- Table structure for t_order
-- ----------------------------
DROP TABLE IF EXISTS `t_order`;
CREATE TABLE `t_order`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL COMMENT '用户表的用户ID',
  `order_sn` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '订单编号',
  `order_status` smallint(6) NOT NULL COMMENT '订单状态',
  `aftersale_status` smallint(6) NULL DEFAULT 0 COMMENT '售后状态，0是可申请，1是用户已申请，2是管理员审核通过，3是管理员退款成功，4是管理员审核拒绝，5是用户已取消',
  `consignee` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '收货人名称',
  `mobile` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '收货人手机号',
  `address` varchar(127) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '收货具体地址',
  `message` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '用户订单留言',
  `goods_price` decimal(10, 2) NOT NULL COMMENT '商品总费用',
  `freight_price` decimal(10, 2) NOT NULL COMMENT '配送费用',
  `coupon_price` decimal(10, 2) NOT NULL COMMENT '优惠券减免',
  `integral_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '用户积分减免',
  `groupon_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '团购优惠价减免',
  `order_price` decimal(10, 2) NOT NULL COMMENT '订单费用， = goods_price + freight_price - coupon_price',
  `actual_price` decimal(10, 2) NOT NULL COMMENT '实付费用， = order_price - integral_price',
  `pay_id` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '微信付款编号',
  `pay_time` datetime NULL DEFAULT NULL COMMENT '微信付款时间',
  `ship_sn` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '发货编号',
  `ship_channel` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '发货快递公司',
  `ship_time` datetime NULL DEFAULT NULL COMMENT '发货开始时间',
  `refund_amount` decimal(10, 2) NULL DEFAULT NULL COMMENT '实际退款金额，（有可能退款金额小于实际支付金额）',
  `refund_type` varchar(63) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '退款方式',
  `refund_content` varchar(127) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '退款备注',
  `refund_time` datetime NULL DEFAULT NULL COMMENT '退款时间',
  `confirm_time` datetime NULL DEFAULT NULL COMMENT '用户确认收货时间',
  `comments` smallint(6) NULL DEFAULT 0 COMMENT '待评价订单商品数量',
  `end_time` datetime NULL DEFAULT NULL COMMENT '订单关闭时间',
  `add_time` datetime NULL DEFAULT NULL COMMENT '创建时间',
  `receiving_way` tinyint(1) NULL DEFAULT NULL COMMENT '送货方式 0 快递配送 1 门店自提',
  `update_time` datetime NULL DEFAULT NULL COMMENT '更新时间',
  `deleted` tinyint(1) NULL DEFAULT 0 COMMENT '逻辑删除',
  `stores_id` int(11) NULL DEFAULT NULL COMMENT '门店ID',
  `cancel_desc` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '订单取消原因',
  `first_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '商品定金费用',
  `last_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '商品尾款费用= 商品尾款 + 运费- 优惠券减免',
  `first_pay_time` datetime NULL DEFAULT NULL COMMENT '定金支付時間',
  `last_pay_time` datetime NULL DEFAULT NULL COMMENT '尾款支付時間',
  `order_type` tinyint(5) NULL DEFAULT 1 COMMENT '订单类型 1 普通订单 2 预售订单',
  `ac_first_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '实际支付定金金额',
  `ac_last_price` decimal(10, 2) NULL DEFAULT NULL COMMENT '实际支付尾款金额',
  `mailed_type` tinyint(3) NULL DEFAULT NULL COMMENT '邮费类型 2 到付， 1 包邮 ,0 包邮',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `user_id_index`(`user_id`) USING BTREE,
  INDEX `order_sn_index`(`order_sn`) USING BTREE,
  INDEX `order_status_index`(`order_status`) USING BTREE,
  INDEX `receiving_way_index`(`receiving_way`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 316 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '订单表' ROW_FORMAT = COMPACT;

-- ----------------------------
-- Records of t_order
