-- ----------------------------
-- Table structure for t_refund_records
-- ----------------------------
DROP TABLE IF EXISTS `t_refund_records`;
CREATE TABLE `t_refund_records`  (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '退款记录表',
  `refund_no` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '退款單號',
  `user_id` int(11) NOT NULL COMMENT '用户表id',
  `amount` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '退款金额',
  `r_type` int(10) NULL DEFAULT 0 COMMENT '退款方式 1 谷歌退款 2 苹果退款 3 点券退款',
  `r_status` int(11) NOT NULL DEFAULT 0 COMMENT '退款状态 0 申请中 101 退款成功 201 管理员或者门店拒绝退款 301 用户取消退款',
  `u_content` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '用户退款记录说明',
  `a_content` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '管理员退款记录说明',
  `c_order` int(11) NULL DEFAULT NULL COMMENT '订单id 充值为空',
  `add_time` datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `deleted` tinyint(1) NULL DEFAULT 0 COMMENT '是否软删除  1 删除',
  `o_status` int(11) NULL DEFAULT NULL COMMENT '订单状态',
  `refund_sn` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '退款货物退回快递单号',
  `refund_channel` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '退款货物退回快递公司',
  `u_image` varchar(522) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '退款附帶圖片',
  `confirm_time` datetime NULL DEFAULT NULL COMMENT '確認或者取消退款時間',
  `admin_confirm` tinyint(3) NULL DEFAULT 0 COMMENT '后台是否确认收到用户退回来的货物 0 未收货 1已收货',
  `refunde_type` tinyint(3) NULL DEFAULT NULL COMMENT '退款类型 1 仅退款 2 退货退款',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `order_id_index`(`c_order`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 130 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = COMPACT;

-- ----------------------------
-- Records of t_refund_records
-- ----------------------------

-- ----------------------------
-- Table structure for t_region
